import React, { Component } from "react";
import Atitle from "./amenu/Atitle";
import Afavority from "./amenu/Afavority";
import Alink from "./amenu/Alink";

class Amenu extends Component {
  render() {
    return (
      <div className="amenu ">
        <hr className="hr mb-5" />
        <Alink />
        <Afavority />
      </div>
    );
  }
}

export default Amenu;
